import React from 'react'
import { Link } from 'react-router-dom'
function NavBar() {
  return (
    <nav>
        <Link href='/Home/'>Home</Link>
        <Link to='/Search/'>Search Products</Link>
    </nav>
  )
}

export default NavBar
